import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import LoginPage from './components/LoginPage'; // Certifique-se de que o caminho est치 correto
import Foods from './components/Foods'; // Este ser치 um novo componente para a lista de alimentos

function App() {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<LoginPage />} />
        <Route path="/foods" element={<Foods />} />
        <Route path="/reset-password" element={<PasswordResetPage />} /> // Nova rota
      </Routes>
    </Router>
  );
}

export default App;
